import React from 'react';

function PatientDashboard({ user }) {
  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-100 via-white to-blue-200 p-8">
      <h2 className="text-3xl font-bold text-gray-800 text-center mb-6">Patient Dashboard</h2>
      <p>Welcome, {user.username}! This is your dashboard.</p>
    </div>
  );
}

export default PatientDashboard;
